import React from "react"
import { CardContent, Typography, Box } from "@material-ui/core"
import { CircularProgress } from "@mui/material"

export default function FormSuccess({ props }) {
	const { ...data } = props
	console.log(data.responseData.data.data)
	return (
		<CardContent>
			<Typography>
				{data ? (
					<>
						{/* Congratulations {data.firstName} {data.lasstName} */}
						Hello
					</>
				) : (
					<CircularProgress />
				)}
			</Typography>
		</CardContent>
	)
}
